import React from 'react';
import './Textcontent.css';
import OpenSSH from './test';
import Clock from '../Clock/Clock';

const Textcontent = (route,day) => {

    let deg = 6;
    let hh = day.getHours()*30;
    let mm = day.getMinutes()*deg;
    let ss = day.getSeconds()*deg;

    switch (route.route,hh,mm,ss){
        case "/one" : return(<div className='Textcontent'><Clock day={hh,mm,ss}/></div>);

        case "/two" : return(<div className='Textcontent'><OpenSSH/></div>);

        default : 
            return(<div className='Textcontent'><p>Hello</p></div>);
    }

};

export default Textcontent;
